import React, { Component } from 'react'

export default class Test extends Component {
  componentDidMount(){
    this.map = new window.google.maps.Map(document.getElementById("map"), {
      center: {lat: -74.22775268554688, lng: 11.195199752631972},
      zoom: 15
    })
  }
  render() {
    return (
      <div id="map">
      </div>
    )
  }
}
